import React from 'react';
import './TodoListItem.css';

const TodoListItem = (props) =>
{
	const style = {
		color: props.important ? 'red' : 'black'
	};
	return(
		<span className="todolistitem" style={style}>{props.label}</span>
	);
};

export default TodoListItem;
